(function(){let e=$("#friendReqBut");e.click((function(t){t.preventDefault(),$.ajax({type:"post",url:e.prop("href"),success:function(t){t.data.delete?(e.text("Add Friend"),e.attr("href","/friend/newreq/"+t.data.id)):(e.text("Remove Friend"),e.attr("href","/friend/delreq/"+t.data.id)),new Noty({theme:"relax",text:t.message,type:"success",layout:"topRight",timeout:1500}).show()},error:function(e){console.log(e.responseText)}})}))})();